document.addEventListener("DOMContentLoaded",(function(t){const e=document.querySelectorAll(".videos-item");function o(t){return`https://www.youtube.com/oembed?url=http://youtube.com/watch?v=${t}&format=json&origin=http://localhost`}for(const t of e){const{id:e}=t,n=t.querySelector(".videos-item-title"),c=t.querySelector(".videos-item-thumbnail"),r=t.querySelector("a");fetch(o(e)).then((t=>t.json())).then((t=>{console.log(t),n.innerHTML=t.title,c.src=t.thumbnail_url,r.href=`https://youtube.com/watch?v=${e}`})).catch((t=>{console.error(t)}))}}));
